-- had some images encoded in base64 so I'm using that instead of a bytea string

-- the base64 strings of each image were obtained by uploading a sticker,
-- opening the network tab in chrome devtools, navigating to the sticker page in the frontend,
-- and copying the "image_data" field returned from the backend
-- also had to remove the "\n" characters using VSCode's search and replace functionality

-- We also need to use the postgres decode() function to convert it from base64 into bytea
-- https://www.postgresql.org/docs/current/functions-binarystring.html
-- (maybe I should insert it as bytea or store the image files in a folder somewhere)
INSERT INTO image_sticker (sticker_id, image_data)
VALUES (10, decode('', 'base64'));

